import React, { Component } from 'react';
import { Container, Button, Row, Col, Navbar, Alert } from "react-bootstrap";
import axios from 'axios';
import Couriers from './Couriers';
import Configuration from './Configuration';
import Orders from './Orders';

import '../styles/Form.css';
import Logo from'../Images/tazz.png';
import Linkedin from'../Images/Linkedin.png';


export default class Form extends Component {
    state = {
        maxDeliveryTimeMinutes:0,
        assignments:[1]
    }

    async componentDidMount() {/*
        const url = 'http://localhost:8080/couriers';
        const response = await axios.get(url);
        const receivedAssingments = JSON.stringify(response.data.assignments);
        const arrayOfAssignmets = JSON.parse(receivedAssingments);
        this.setState({assignments:arrayOfAssignmets})
        */
    }

    render(){

        return(
            <div>
                  <Navbar bg="dark" variant="dark">
                    <Container>
                    <Navbar.Brand href="#home">
                        <img
                            alt=""
                            src={Logo}
                            width="100"
                            className="d-inline-block align-top"
                        />{' '}
                        Online Assignment
                    </Navbar.Brand>
                    </Container>
                </Navbar>

                <Container>
                    <Alert variant="warning"  dismissible>
                        <Alert.Heading>Oh snap! You got an error!</Alert.Heading>
                        <p>
                            Change this and that and try again. Duis mollis, est non commodo
                            luctus, nisi erat porttitor ligula, eget lacinia odio sem nec elit.
                            Cras mattis consectetur purus sit amet fermentum.
                        </p>
                    </Alert>
                    <Row>
                        <Col>
                            <Couriers/>
                        </Col>
                        <Col>
                            <Orders/>
                        </Col>
                    </Row>
                    <Row>
                        <Col>
                            <Configuration/>
                        </Col>
                    </Row>
                    <Row>
                        <Col className='text-center mb-5'>
                            <Button variant="primary">Submit</Button> 
                        </Col>
                    </Row>
                </Container>
                
                <footer class="bg-light text-center text-lg-start">
                    <div class="text-center p-3 footer">
                        Created by Vadim Pislari  
                        <a class="text-dark" href="https://www.linkedin.com/in/vadim-pislari-364679173/">
                                <img
                                    alt=""
                                    src={Linkedin}
                                    width="30"
                                    className="d-inline-block linkedin"
                                />{' '}
                        </a>
                    </div>
                </footer>
            </div>
        );
    }
}
